import React from "react";

function add(x,y){
    let sum=x+y;
    return sum;
    }
    function sub(x,y){
    let sub=x-y;
    return sub;
    }
    function mult(x,y){
    let mult=x*y;
    return mult;
    }
    function  div(x,y){
    let div=x/y;
    return div;
    }
    // export default add;
    export {add,sub,mult,div};
